import styled from "styled-components";
import { COLORS, containerStyle, FONTS } from "../../assets/styles";

export default {
  Container: styled.div`
    margin: 30px 120px;
    width: 100%;
    ${containerStyle};
  `,
  Switcher: styled.div`
    padding: 25px;
    display: flex;
    flex-direction: row;
  `,
  Button: styled.div`
    padding: 19px 0px;
    width: 50%;
    text-align: center;
    font-family: ${FONTS.SEGOE_UI};
    font-weight: 600;
    font-size: 14px;
    line-height: 19px;
    color: ${COLORS.NIMBLE_RED};
    cursor: pointer;
    border-bottom: ${COLORS.NIMBLE_RED};
  `,
};
